Chuck is an action-comedy-drama television program from the United States created by Josh Schwartz and Chris Fedak. The series is about an &quot;average computer-whiz-next-door&quot; who receives an encoded e-mail from an old college friend now working in the CIA; the message embeds the only remaining copy of the world's greatest spy secrets into Chuck's brain.
