Produced by College Hill Pictures, Wonderland Sound and Vision and Warner Bros. Television, the series premiered on September 24, 2007, on NBC, airing on Monday nights at 8/7c leading into Heroes.
On May 13, 2010, it was announced that Chuck had been renewed for a fourth season of 13 episodes. Unlike the third season which was held as a midseason replacement, Chuck will appear on NBC's fall 2010 schedule in its traditional Monday 8/7c timeslot. Season 4 will air with &quot;Chuck Versus the Anniversary&quot;, September 20, 2010.

